import React from 'react'

const SearchBar = (text) => (
    <SearchBar round
        searchIcon={{ size: 24 }}
        onChangeText={text => this.SearchFilterFunction(text)} onClear={text => this.SearchFilterFunction('')} placeholder="Type Here..."
        value={this.state.search}
    />
)

export default SearchBar
